    private void btnDiagnosticarActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_btnDiagnosticarActionPerformed
        // TODO add your handling code here:
        if (compruebaSeleccion() == false) {
            JOptionPane.showMessageDialog(this, "POR FAVOR SELECCIONE POR LO MENOS UN SINTOMA ");
        } else if (pregunta1.isSelected() && Pregunta15.isSelected() && Pregunta13.isSelected() == true) {
            if (Pregunta14.isSelected() || Pregunta3.isSelected() || Pregunta4.isSelected()
                    || Pregunta6.isSelected() || Pregunta9.isSelected() || Pregunta11.isSelected()
                    || Pregunta10.isSelected() || Pregunta17.isSelected() || Pregunta18.isSelected()
                    || Pregunta19.isSelected() || Pregunta7.isSelected() || Pregunta16.isSelected() == true) {
            }
            JOptionPane.showConfirmDialog(this, "USTED TIENE MIGRAÑA SIN AURA");
            jTextArea1.setText("EL TRATAMIENTO A SEGUIR ES........");

        } else if (Pregunta20.isSelected() && pregunta1.isSelected() && Pregunta12.isSelected() == true) {
            if (Pregunta2.isSelected() || Pregunta3.isSelected() || Pregunta4.isSelected()
                    || Pregunta5.isSelected() || Pregunta6.isSelected() || Pregunta7.isSelected()
                    || Pregunta8.isSelected() || Pregunta9.isSelected() || Pregunta10.isSelected()
                    || Pregunta11.isSelected() || Pregunta13.isSelected() || Pregunta14.isSelected()
                    || Pregunta15.isSelected() || Pregunta16.isSelected() || Pregunta17.isSelected()
                    || Pregunta18.isSelected() || Pregunta19.isSelected() || Pregunta20.isSelected()
                    == true) {
            }
            JOptionPane.showConfirmDialog(this, "USTED TIENE MIGRAÑA CON AURA");
            jTextArea1.setText("EL TRATAMIENTO A SEGUIR ES.III.......");

        } else if (pregunta1.isSelected() == true) {
            if (Pregunta18.isSelected() || Pregunta19.isSelected()
                    || Pregunta7.isSelected() || Pregunta8.isSelected()
                    || Pregunta16.isSelected() || Pregunta19.isSelected()
                    == true) {
                JOptionPane.showConfirmDialog(this, "USTED TIENE UN DOLOR DE CABEZA NORMAL");
            } else
            JOptionPane.showConfirmDialog(this, "CONSULTE A SU MÉDICO PARA QUE DIAGNOSTIQUE SU DOLENCIA O ADICIONE OTRO SÍNTOMA");
        } else {
            JOptionPane.showConfirmDialog(this, "CONSULTE A SU MÉDICO PARA QUE DIAGNOSTIQUE SU DOLENCIA");
        }
    }//GEN-LAST:event_btnDiagnosticarActionPerformed

