    public boolean compruebaSeleccion() {

        Object[] componentes = jPanel2.getComponents();

        for (int i = 0; i < componentes.length; i++) {
            JCheckBox pre1 = (JCheckBox) componentes[i];
            if (pre1.isSelected() == true) {
                return true;
            }
        }
        return false;
    }

    public boolean compruebaDesSeleccion() {

        Object[] componentes = jPanel2.getComponents();

        for (int i = 0; i < componentes.length; i++) {
            JCheckBox pre1 = (JCheckBox) componentes[i];
            if (pre1.isSelected() == true) {
                return true;
            }
        }
        return false;
    }

